import React from 'react';
import '../styles/cover.css'
import logo_white from './icons/logo_white.png';
import Typical from 'react-typical'
import 'bootstrap/dist/css/bootstrap.min.css';
import bot_section from './icons/bot_section.png';
import '../styles/bot-section.css';
import Button from 'react-bootstrap/Button';
import '../styles/eva.css';
import sample from './icons/sample.MOV'



class EVA extends React.Component {
  render() {

    return (
         <div>
        <head>
          <meta charset="UTF-8"></meta>
          <meta name="viewport" content="width=device-width, initial-scale=1.0"></meta>
          <meta http-equiv="X-UA-Compatible" content="ie=edge"></meta>
          <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/meyer-reset/2.0/reset.min.css"></link>
          <link href="https://fonts.googleapis.com/css?family=Cookie" rel="stylesheet"></link>
          <link rel="stylesheet" href="style.css"></link>
          <title>Video Background</title>
        </head>
        <body>
          <div class="section">
            <h1>Welcome to paradise</h1>
            <video autoplay loop muted>

            </video>
          </div>
        </body>
      </div>
    );
  }
}
export default EVA;
